INSERT INTO `page_html_parts` VALUES (1,'info_voice_sections','You can think of a voice section as the cross-section of a voice and section. It is the smallest configurable unit of the fractal piece. The settings of the voice and section will be used unless “override voice settings” or “override section settings” are checked.','<p>You can think of a voice section as the cross-section of a voice and section. It is the smallest configurable unit of the fractal piece. The settings of the voice and section will be used unless “override voice settings” or “override section settings” are checked.</p>','2008-06-25 19:22:19','2008-06-25 19:22:19'),(2,'info_piece_settings','On this tab, you can specify settings that apply to your entire fractal piece.','<p>On this tab, you can specify settings that apply to your entire fractal piece.</p>','2008-06-25 19:22:31','2008-06-25 19:22:31'),(3,'info_sections','On this tab, you can specify settings for each of the \"sections\":http://en.wikipedia.org/wiki/Section_%28music%29 of your fractal piece.','<p>On this tab, you can specify settings for each of the <a href=\"http://en.wikipedia.org/wiki/Section_%28music%29\">sections</a> of your fractal piece.</p>','2008-06-25 19:23:03','2008-06-25 19:23:03'),(4,'info_voices','On this tab, you can specify settings for each of the voices of your fractal piece. Each voice is a single melodic line, as in \"polyphony\":http://en.wikipedia.org/wiki/Voice_%28polyphony%29.','<p>On this tab, you can specify settings for each of the voices of your fractal piece. Each voice is a single melodic line, as in <a href=\"http://en.wikipedia.org/wiki/Voice_%28polyphony%29\">polyphony</a>.</p>','2008-06-25 19:23:35','2008-06-25 19:23:35'),(5,'info_self_similarity','\"Self-similarity\":http://en.wikipedia.org/wiki/Self-similarity is the defining characteristic of the music generated by this website. Just as self-similarity can be applied to geometric shapes, it can also be applied to a music. You can apply self-similarity to any or all of these aspects of the germ:\n\n* *Pitch*: \"Scalar transposition\":http://en.wikipedia.org/wiki/Transposition_(music)#Two_different_types will be applied to each note of the germ, based on the shape of the germ. The effect will be similar to a \"sequence\":http://en.wikipedia.org/wiki/Sequence_%28music%29.\n* *Rhythm*: The rhythms of each part of the phrase will be scaled based on the rhythmic shape of the germ.\n* *Volume*: The volumes of each part of the phrase will be scaled based on the dynamic shape of the germ.\n\nNote that inversion and/or retrograde, as specified by the section or voice section, will be applied to the germ before self-similarity is applied.','<p><a href=\"http://en.wikipedia.org/wiki/Self-similarity\">Self-similarity</a> is the defining characteristic of the music generated by this website. Just as self-similarity can be applied to geometric shapes, it can also be applied to a music. You can apply self-similarity to any or all of these aspects of the germ:</p>\n\n\n	<ul>\n	<li><strong>Pitch</strong>: <a href=\"http://en.wikipedia.org/wiki/Transposition_(music)#Two_different_types\">Scalar transposition</a> will be applied to each note of the germ, based on the shape of the germ. The effect will be similar to a <a href=\"http://en.wikipedia.org/wiki/Sequence_%28music%29\">sequence</a>.</li>\n		<li><strong>Rhythm</strong>: The rhythms of each part of the phrase will be scaled based on the rhythmic shape of the germ.</li>\n		<li><strong>Volume</strong>: The volumes of each part of the phrase will be scaled based on the dynamic shape of the germ.</li>\n	</ul>\n\n\n	<p>Note that inversion and/or retrograde, as specified by the section or voice section, will be applied to the germ before self-similarity is applied.</p>','2008-06-25 19:25:10','2008-06-25 19:25:10'),(6,'info_override_section_settings','If checked, this voice section will have its own section settings rather than just using the settings set on the section.','<p>If checked, this voice section will have its own section settings rather than just using the settings set on the section.</p>','2008-06-25 19:25:34','2008-06-25 19:25:34'),(7,'info_override_voice_settings','If checked, this voice section will have its own voice settings rather than just using the settings set on the voice.','<p>If checked, this voice section will have its own voice settings rather than just using the settings set on the voice.</p>','2008-06-25 19:25:49','2008-06-25 19:25:49'),(8,'info_rest','If checked, this voice section will be a rest. This setting takes priority over all other voice section settings.','<p>If checked, this voice section will be a rest. This setting takes priority over all other voice section settings.</p>','2008-06-25 19:26:07','2008-06-25 19:26:07'),(9,'info_apply_retrograde','If checked, \"retrograde\":http://en.wikipedia.org/wiki/Counterpoint#Contrapuntal_derivations will be applied to the germ. The germ will be played backwards.','<p>If checked, <a href=\"http://en.wikipedia.org/wiki/Counterpoint#Contrapuntal_derivations\">retrograde</a> will be applied to the germ. The germ will be played backwards.</p>','2008-06-25 19:26:40','2008-06-25 19:26:40'),(10,'info_apply_inversion','If checked, \"inversion\":http://en.wikipedia.org/wiki/Inversion_%28music%29#Inverted_melodies will be applied to the germ. The germ will be played upside down.','<p>If checked, <a href=\"http://en.wikipedia.org/wiki/Inversion_%28music%29#Inverted_melodies\">inversion</a> will be applied to the germ. The germ will be played upside down.</p>','2008-06-25 19:27:27','2008-06-25 19:27:27'),(11,'info_override_scale','If checked, you can use a different scale and/or key for this section from the scale and key which is set for the entire piece. This can be used to put a section in a different key or tonality (i.e. major or minor). \n\nHowever, take care when selecting a scale with a different number of pitches, as the results are a bit unpredictable. For example, if the scale set for the piece is a major scale (with 7 different pitches) a pentatonic scale (with 5 pitches) should not be used here.','<p>If checked, you can use a different scale and/or key for this section from the scale and key which is set for the entire piece. This can be used to put a section in a different key or tonality (i.e. major or minor).</p>\n\n\n	<p>However, take care when selecting a scale with a different number of pitches, as the results are a bit unpredictable. For example, if the scale set for the piece is a major scale (with 7 different pitches) a pentatonic scale (with 5 pitches) should not be used here.</p>','2008-06-25 19:28:19','2008-06-25 19:28:19'),(12,'info_tempo','Specifies the tempo in beats per minute for the generated midi file.','<p>Specifies the tempo in beats per minute for the generated midi file.</p>','2008-06-25 19:28:45','2008-06-25 19:28:45'),(13,'info_germ','Specifies the short melody from which the piece is generated. You can think of it as the “shape” of the fractal. The germ should be a series of notes, seperated by spaces.\n\nEach note must have the following:\n\n* \"Pitch Class\":http://en.wikipedia.org/wiki/Pitch_class: A letter name (A-G), optionally followed by an accidental (bb, b, # or x).\n* Octave: A number from 0 to 9 specifying which octave this note is in. The \"Acoustical Society of America’s octave designation system\":http://en.wikipedia.org/wiki/Scientific_pitch_notation is used. Each octave runs from C to B. C4 to B4 is the octave from middle C to the B above middle C.\n\nIn addition, you can optionally include the following:\n\n* Rhythmic Duration: A fraction indicating how long the note should last. For example, 1/4 indicates a quarter note, 3/8 a dotted quarter note and 1/12 indicates one note of an eighth note triplet. If no duration is given, the duration of the previous note is used. The first note will be a quarter note if no duration is given.\n* Volume: One of PPP, PP, P, MP, MF, F, FF or FFF. If none is given, the volume of the previous note is used. The first note will be MF if no volume is given.\n\nIf you include a rhythmic duration or volume, use a comma to seperate it from the pitch information.','<p>Specifies the short melody from which the piece is generated. You can think of it as the “shape” of the fractal. The germ should be a series of notes, seperated by spaces.</p>\n\n\n	<p>Each note must have the following:</p>\n\n\n	<ul>\n	<li><a href=\"http://en.wikipedia.org/wiki/Pitch_class\">Pitch Class</a>: A letter name (A-G), optionally followed by an accidental (bb, b, # or x).</li>\n		<li>Octave: A number from 0 to 9 specifying which octave this note is in. The <a href=\"http://en.wikipedia.org/wiki/Scientific_pitch_notation\">Acoustical Society of America’s octave designation system</a> is used. Each octave runs from C to B. C4 to B4 is the octave from middle C to the B above middle C.</li>\n	</ul>\n\n\n	<p>In addition, you can optionally include the following:</p>\n\n\n	<ul>\n	<li>Rhythmic Duration: A fraction indicating how long the note should last. For example, 1/4 indicates a quarter note, 3/8 a dotted quarter note and 1/12 indicates one note of an eighth note triplet. If no duration is given, the duration of the previous note is used. The first note will be a quarter note if no duration is given.</li>\n		<li>Volume: One of <span class=\"caps\">PPP</span>, PP, P, MP, MF, F, FF or <span class=\"caps\">FFF</span>. If none is given, the volume of the previous note is used. The first note will be MF if no volume is given.</li>\n	</ul>\n\n\n	<p>If you include a rhythmic duration or volume, use a comma to seperate it from the pitch information.</p>','2008-06-25 19:29:57','2008-06-25 19:29:57'),(14,'info_time_signature','Specifies the time signature used in the generated notation. The time signature should be given in fractional form. The denominator must be a power of 2 (e.g., 2, 4, 8 or 16).','<p>Specifies the time signature used in the generated notation. The time signature should be given in fractional form. The denominator must be a power of 2 (e.g., 2, 4, 8 or 16).</p>','2008-06-25 19:30:25','2008-06-25 19:30:25'),(15,'info_instrument','Specifies the instrument for this voice. The appropriate midi sound will be used, based on your selection.','<p>Specifies the instrument for this voice. The appropriate midi sound will be used, based on your selection.</p>','2008-06-25 19:30:42','2008-06-25 19:30:42'),(16,'info_octave_adjustment','Specifies the number of octaves to transpose the germ. Positive numbers indicate that the germ should be transposed up; negative numbers indicate that the germ should be transposed down.','<p>Specifies the number of octaves to transpose the germ. Positive numbers indicate that the germ should be transposed up; negative numbers indicate that the germ should be transposed down.</p>','2008-06-25 19:31:15','2008-06-25 19:31:15'),(17,'info_rhythm_scale_factor','Specifies a factor that is used to scale the rhythmic durations of each note. It should be given in integer or fractional form. Factors greater than 1 will result in faster rhythms; factors between 0 and 1 will result in slower rhythms.\n\nFor example, a rhythm scale factor of 2 means the rhythmic durations will be scaled so that the result is twice as fast. A rhythm scale factor of 1/2 means the rhythmic durations will be scaled so that the result is half as fast.','<p>Specifies a factor that is used to scale the rhythmic durations of each note. It should be given in integer or fractional form. Factors greater than 1 will result in faster rhythms; factors between 0 and 1 will result in slower rhythms.</p>\n\n\n	<p>For example, a rhythm scale factor of 2 means the rhythmic durations will be scaled so that the result is twice as fast. A rhythm scale factor of 1/2 means the rhythmic durations will be scaled so that the result is half as fast.</p>','2008-06-25 19:31:37','2008-06-25 19:31:37'),(18,'info_self_similarity_iterations','Specifies how many times self-similarity should be applied to the germ.','<p>Specifies how many times self-similarity should be applied to the germ.</p>','2008-06-25 19:31:57','2008-06-25 19:31:57'),(19,'info_generate_layered_intro','If checked, the generated piece will include an intro section that layers the germ in the different voices to provide a nice build into the first section.','<p>If checked, the generated piece will include an intro section that layers the germ in the different voices to provide a nice build into the first section.</p>','2008-06-25 19:32:25','2008-06-25 19:32:25'),(20,'info_generate_layered_outro','If checked, the generated piece will include an outro section that layers the germ in the different voices to provide a nice fade out after the final section.','<p>If checked, the generated piece will include an outro section that layers the germ in the different voices to provide a nice fade out after the final section.</p>','2008-06-25 19:32:44','2008-06-25 19:32:44'),(21,'info_scale_type_and_key','Specifies the scale type and key to use. Generally speaking, you should make sure that all of the notes of your germ are part of the selected scale and key. Notes that are not part of the scale will create excessively dissonant sections.\n\nIf you are trying to minimize dissonance, consider using one of the pentatonic scales. This will eliminate the most dissonant intervals (minor seconds, major sevenths and tritones), as long as all the notes in your germ are part of the selected pentatonic scale.','<p>Specifies the scale type and key to use. Generally speaking, you should make sure that all of the notes of your germ are part of the selected scale and key. Notes that are not part of the scale will create excessively dissonant sections.</p>\n\n\n	<p>If you are trying to minimize dissonance, consider using one of the pentatonic scales. This will eliminate the most dissonant intervals (minor seconds, major sevenths and tritones), as long as all the notes in your germ are part of the selected pentatonic scale.</p>','2008-06-25 19:33:04','2008-06-25 19:33:04');
